      description: 'American, raw, meaty',
      price: 12.99,
    },
    {
      id: 'm4',
      name: 'Green Bowl',
      description: 'Healthy...and green...',
      price: 18.99,
    },
  ];
const AvailableMeals=()=>{
    console.log("evaluating AvailableMeals")
    const mealsList=DUMMY_MEALS.map(meal=> {return <MealItem key={meal.id} id={meal.id} name={meal.name} description={meal.description} price={meal.price}/>})
    return <section className={classes.meals} >
        <Card>
        <ul>
            {mealsList}
        </ul>
        {console.log("Running Available Meals")}
        </Card>
    </section>
}
export default AvailableMeals;
